[{"location":"appendix/#Bijlage","page":"Appendix","title":"Bijlage","text":"","category":"section"},{"location":"appendix/","page":"Appendix","title":"Appendix","text":"info: Info\nZorg ervoor dat je toestemming hebt van een ouder of verantwoordelijke volwassene voordat je iets downloadt op je computer. Als je hulp nodig hebt tijdens het downloaden en installeren, vraag dan aan een ouder of verantwoordelijke volwassene om je te helpen.","category":"page"},{"location":"appendix/#Introduction","page":"Appendix","title":"Introduction","text":"","category":"section"},{"location":"appendix/","page":"Appendix","title":"Appendix","text":"Ik heb zelf een Lenovo Legion Y520 Windows 10 laptop met Ubuntu 22.04 ge√Ønstalleerd op een Samsung portable SSD T5 schijf. Ik start mijn machine op vanaf deze schijf.","category":"page"},{"location":"blog/#Blog","page":"Blog","title":"Blog","text":"","category":"section"},{"location":"blog/#","page":"Blog","title":"2024","text":"","category":"section"},{"location":"blog/#/24/2024Placing-Ed-Donner's-repository-in-a-separate-folder-is-a-good-practice.","page":"Blog","title":"12/24/2024Placing Ed Donner's repository in a separate folder is a good practice.","text":"","category":"section"},{"location":"blog/","page":"Blog","title":"Blog","text":"I recommend storing Ed Donner's repository in a separate folder. This allows you to upload and save his notebook files independently, making it easier to track your work.","category":"page"},{"location":"blog/#/20/2024-Set-up-of-the-course","page":"Blog","title":"12/20/2024 - Set up of the course","text":"","category":"section"},{"location":"blog/","page":"Blog","title":"Blog","text":"Today set up of the basic structure for the LLM course.","category":"page"},{"location":"references/#References","page":"References","title":"References","text":"","category":"section"},{"location":"references/#YouTube","page":"References","title":"YouTube","text":"","category":"section"},{"location":"references/#Diversen","page":"References","title":"Diversen","text":"","category":"section"},{"location":"chapter1/#Install-Docker","page":"1 Install Docker","title":"Install Docker","text":"","category":"section"},{"location":"chapter1/","page":"1 Install Docker","title":"1 Install Docker","text":"I use docker mainly because it gives me a cleaner environment and less trouble.","category":"page"},{"location":"chapter1/","page":"1 Install Docker","title":"1 Install Docker","text":"UNDER DEVELOPMENT","category":"page"},{"location":"chapter1/","page":"1 Install Docker","title":"1 Install Docker","text":"Content","category":"page"},{"location":"chapter1/","page":"1 Install Docker","title":"1 Install Docker","text":"Pages = [\"chapter1.md\"]","category":"page"},{"location":"chapter1/#Prerequisites","page":"1 Install Docker","title":"Prerequisites","text":"","category":"section"},{"location":"chapter1/","page":"1 Install Docker","title":"1 Install Docker","text":"A PC or laptop running Ubuntu 22.04 is required.","category":"page"},{"location":"chapter1/#What-you-will-do.","page":"1 Install Docker","title":"What you will do.","text":"","category":"section"},{"location":"chapter1/","page":"1 Install Docker","title":"1 Install Docker","text":"Step 1: Install Docker","category":"page"},{"location":"chapter1/#Install-Docker-2","page":"1 Install Docker","title":"Install Docker","text":"","category":"section"},{"location":"chapter1/","page":"1 Install Docker","title":"1 Install Docker","text":"To install Docker follow the next steps:","category":"page"},{"location":"chapter1/","page":"1 Install Docker","title":"1 Install Docker","text":"Step Action\n1 Open a new terminal.\n2 Update the software list by typing: sudo apt update.\n3 Remove older versions of Docker by typing: sudo apt remove docker docker-engine docker.io.\n4 Install Docker: curl -sSL https://get.docker.com | sh.\n5 Make sure you will have root rights: sudo usermod -aG docker $USER.\n6 Controle the version of Docker Engine: sudo docker version. Must be versie 20.10.22 of higher.\n7 Restart your computer by tying: sudo reboot.\n ","category":"page"},{"location":"chapter2/#Install-the-MiniConda-container","page":"2 Install the MiniConda container","title":"Install the MiniConda container","text":"","category":"section"},{"location":"chapter2/","page":"2 Install the MiniConda container","title":"2 Install the MiniConda container","text":"In this chapter you will learn how te create a container with MiniConda with a .yml file","category":"page"},{"location":"chapter2/","page":"2 Install the MiniConda container","title":"2 Install the MiniConda container","text":"UNDER DEVELOPMENT","category":"page"},{"location":"chapter2/","page":"2 Install the MiniConda container","title":"2 Install the MiniConda container","text":"Content","category":"page"},{"location":"chapter2/","page":"2 Install the MiniConda container","title":"2 Install the MiniConda container","text":"Pages = [\"chapter2.md\"]","category":"page"},{"location":"chapter2/#Prerequisites","page":"2 Install the MiniConda container","title":"Prerequisites","text":"","category":"section"},{"location":"chapter2/","page":"2 Install the MiniConda container","title":"2 Install the MiniConda container","text":"A PC or laptop running Ubuntu 22.04 with Docker installed is required.","category":"page"},{"location":"chapter2/#What-you-will-do.","page":"2 Install the MiniConda container","title":"What you will do.","text":"","category":"section"},{"location":"chapter2/","page":"2 Install the MiniConda container","title":"2 Install the MiniConda container","text":"Step 1: Install the MiniConda container","category":"page"},{"location":"chapter2/#compose.yml","page":"2 Install the MiniConda container","title":"compose.yml","text":"","category":"section"},{"location":"chapter2/","page":"2 Install the MiniConda container","title":"2 Install the MiniConda container","text":"version: \"3.9\" # Use the latest version of the Docker Compose file format\n\nservices:\n  jupyter-notebook:\n    image: continuumio/miniconda3\n    ports:\n      - \"8888:8888\"\n    command: \n      - /bin/bash\n      - \"-c\"\n      - |\n        conda install jupyter -y --quiet && \\\n        mkdir -p /opt/notebooks && \\\n        jupyter notebook \\\n          --notebook-dir=/opt/notebooks \\\n          --ip='*' \\\n          --port=8888 \\\n          --no-browser \\\n          --allow-root\n    volumes:\n      - ./notebooks:/opt/notebooks \n    tty: true\n    stdin_open: true","category":"page"},{"location":"chapter2/#Install-MiniConda-container","page":"2 Install the MiniConda container","title":"Install MiniConda container","text":"","category":"section"},{"location":"chapter2/","page":"2 Install the MiniConda container","title":"2 Install the MiniConda container","text":"To install MiniConda container follow the next steps:","category":"page"},{"location":"chapter2/","page":"2 Install the MiniConda container","title":"2 Install the MiniConda container","text":"Step Action\n1 Open a new terminal.\n2 Update the software list by typing: sudo apt update.\n3 Create a subdirectory Test: makedir ~/Test.\n4 Move to Test: cd ~/Test.\n5 Copy the content of compose.yml to the clipboard by clicking on the copy symbol (at the righthand top) under the file compose.yml .\n6 Create the the file by typing: nano compose.yml.\n7 Paste the text on clipboard into nano: Ctrl+Shift+V.\n8 Save the file: Ctrl+O.\n9 Exit nano: Ctrl+X.\n10 Create the container being still in the ~/Test directory: docker-compose -f compose.yml -d.\n ","category":"page"},{"location":"chapter2/","page":"2 Install the MiniConda container","title":"2 Install the MiniConda container","text":"In the next chapter you will learn how to achieve the Jupyter API-key you need to login to the container and make use of Jupyter.","category":"page"},{"location":"chapter4/#How-to-get-ChatGPT's-API-key","page":"4 How to get ChatGPT's API key","title":"How to get ChatGPT's API key","text":"","category":"section"},{"location":"chapter4/","page":"4 How to get ChatGPT's API key","title":"4 How to get ChatGPT's API key","text":"UNDER DEVELOPMENT","category":"page"},{"location":"overview/#Overview-Linux-Terminal-commando's","page":"Overview Linux Terminal commando's","title":"Overview Linux Terminal commando's","text":"","category":"section"},{"location":"overview/#Overview-Node-RED","page":"Overview Linux Terminal commando's","title":"Overview Node-RED","text":"","category":"section"},{"location":"overview/#Overzicht-MicroPython","page":"Overview Linux Terminal commando's","title":"Overzicht MicroPython","text":"","category":"section"},{"location":"overview/#Summary","page":"Overview Linux Terminal commando's","title":"Summary","text":"","category":"section"},{"location":"overview/","page":"Overview Linux Terminal commando's","title":"Overview Linux Terminal commando's","text":"Top","category":"page"},{"location":"chapter3/#Start-the-MiniConda-container","page":"3 Start the MiniConda container","title":"Start the MiniConda container","text":"","category":"section"},{"location":"chapter3/","page":"3 Start the MiniConda container","title":"3 Start the MiniConda container","text":"UNDER DEVELOPMENT","category":"page"},{"location":"chapter3/","page":"3 Start the MiniConda container","title":"3 Start the MiniConda container","text":"Unfortunately, every time you will have to start the MiniConda container. However, the first time you need to retrieve the Jupyter API-key. When we login the the key we will see the content of the ~/Test/notebooks directory. The jupyter directtory called notebooks will be created for you.","category":"page"},{"location":"chapter3/","page":"3 Start the MiniConda container","title":"3 Start the MiniConda container","text":"content","category":"page"},{"location":"chapter3/","page":"3 Start the MiniConda container","title":"3 Start the MiniConda container","text":"Pages = [\"chapter3.md\"]","category":"page"},{"location":"chapter3/#Prerequisites","page":"3 Start the MiniConda container","title":"Prerequisites","text":"","category":"section"},{"location":"chapter3/","page":"3 Start the MiniConda container","title":"3 Start the MiniConda container","text":"A PC or laptop running Ubuntu 22.04 with Git installed is required.","category":"page"},{"location":"chapter3/#What-you-will-do.","page":"3 Start the MiniConda container","title":"What you will do.","text":"","category":"section"},{"location":"chapter3/","page":"3 Start the MiniConda container","title":"3 Start the MiniConda container","text":"Step 1: Create a directory ~/Test, where you create the file compose.yml.","category":"page"},{"location":"chapter3/","page":"3 Start the MiniConda container","title":"3 Start the MiniConda container","text":"Step 2: Create a directory ~/Test_Ed, where you clone Ed's repository.","category":"page"},{"location":"chapter3/","page":"3 Start the MiniConda container","title":"3 Start the MiniConda container","text":"Step 3: Open a Notebook.","category":"page"},{"location":"chapter3/#compose.yml","page":"3 Start the MiniConda container","title":"compose.yml","text":"","category":"section"},{"location":"chapter3/","page":"3 Start the MiniConda container","title":"3 Start the MiniConda container","text":"version: \"3.9\" # Use the latest version of the Docker Compose file format\n\nservices:\n  jupyter-notebook:\n    image: continuumio/miniconda3\n    ports:\n      - \"8888:8888\"\n    command: \n      - /bin/bash\n      - \"-c\"\n      - |\n        conda install jupyter -y --quiet && \\\n        mkdir -p /opt/notebooks && \\\n        jupyter notebook \\\n          --notebook-dir=/opt/notebooks \\\n          --ip='*' \\\n          --port=8888 \\\n          --no-browser \\\n          --allow-root\n    volumes:\n      - ./notebooks:/opt/notebooks \n    tty: true\n    stdin_open: true","category":"page"},{"location":"chapter3/#Step-1:-Create-a-directory-/Test,-where-you-create-the-file-compose.yml.","page":"3 Start the MiniConda container","title":"Step 1: Create a directory ~/Test, where you create the file compose.yml.","text":"","category":"section"},{"location":"chapter3/","page":"3 Start the MiniConda container","title":"3 Start the MiniConda container","text":"Docker will use the comose.yml file to create the MiniConda container. You can access this containeer with your browser on port 8888.","category":"page"},{"location":"chapter3/","page":"3 Start the MiniConda container","title":"3 Start the MiniConda container","text":"Step Action\n1 Create ~/Test: mkdir ~/Test\n2 Goto the directory: cd ~/Test\n3 Create the file: nano compose.yml\n4 Go to the file compose.yml and click on the copy-symbol at the right-hand corner to copy the content to the clipboard.\n5 Paste the content into the file: Ctrl+Shift+V.\n6 Create the container: docker-compose -f compose.yml -d.\n7 Display the name of the container: docker container ls.\n8 Enter the container to get Jupyter's token: docker exec -it <name of the container> bash\n9 Display te token: jupyter server list.\n10 Save the token somewhere you can retrieve it.\n11 Start the container, so you can retrieve it with your browser: localhost:8888.\n12 Enter the token in the first field and press the Enter-button.\n13 Leave the browser.","category":"page"},{"location":"chapter3/#Step-2:-Create-a-directory-/Test*Ed,-and-clone-Ed-Donner's-repo:-mkdir-Test*Ed.","page":"3 Start the MiniConda container","title":"Step 2: Create a directory ~/TestEd, and clone Ed Donner's repo: `mkdir TestEd`.","text":"","category":"section"},{"location":"chapter3/","page":"3 Start the MiniConda container","title":"3 Start the MiniConda container","text":"You will need a copy of Ed Donner's repository. with the notebook file. The notebook file can be uploaded to the MiniConda container and, so you can work with the notebooks.","category":"page"},{"location":"chapter3/","page":"3 Start the MiniConda container","title":"3 Start the MiniConda container","text":"Step Action\n1 Start a container, make use of autocompletion with the tab-button: docker start test_jupyter-notebook.\n2 Enter the container (use autocomplete button Tab, after typing test): docker exec -it test_jupyter-notebook_1 bash\n3 Get the key by copying the key to the clipboard after highliting the key after token=': jupyter server list.\n4 Enter the container: localhost:8888.\n5 Paste the key in the first field and press Enter.\n6 Leave ther container: Ctrl+D\n7 Goto ~/Test/notebooks: cd ~/Test/notebooks.\n8 Clone Ed's repository: git clone https://github.com/ed-donner/llm_engineering.git.\n9 Restart the container and enter it.\n10 Double click on: llm_engineering.\n11 Open the Week1 folder.\n12 Duble click on: Day1.ipynb. Now you can work with this file\n ","category":"page"},{"location":"chapter3/","page":"3 Start the MiniConda container","title":"3 Start the MiniConda container","text":"When we start the MiniConda contaier we will first retrieve the Jupyter API-key. Then we login the the key we will try to open a Notebook from ~/Test_Ed directory.","category":"page"},{"location":"chapter3/#Step-3:-Open-a-Notebook.","page":"3 Start the MiniConda container","title":"Step 3: Open a Notebook.","text":"","category":"section"},{"location":"chapter3/","page":"3 Start the MiniConda container","title":"3 Start the MiniConda container","text":"Step Action\n1 Start a container, make use of autocompletion with the tab-button: docker start test_jupyter-notebook.\n2 Connect to the container using the browser: localhost:8888.\n3 Click on the Upload-button.\n4 Navigate to the Test_Ed folder.\n5 Open the folder, and open the llm_engineering folder.\n6 Open the week1 folder.\n7 Select the day1.ipnd file. The screen changed.\n8 Open the file by double clicking.\n9 Now you can work with the Notebook file.\n10 Load the other Notebooks of week1. When you look at ~/Test/notebooks you will see the uploaded files, which you can save with: Ctrl+S.\n ","category":"page"},{"location":"chapter3/#Summary","page":"3 Start the MiniConda container","title":"Summary","text":"","category":"section"},{"location":"chapter3/","page":"3 Start the MiniConda container","title":"3 Start the MiniConda container","text":"My experience is that I only have to enter the Jupter-key once! When I connect to the container I allways get an overviw of the Notebooks I uploaded. I am not finished yet with this chapter!","category":"page"},{"location":"chapter3/","page":"3 Start the MiniConda container","title":"3 Start the MiniConda container","text":"We are not finished yet. To work with ChatGPT we first have to put its API-key in a file named: .env.","category":"page"},{"location":"chapter3/#Some-Docker-commands","page":"3 Start the MiniConda container","title":"Some Docker commands","text":"","category":"section"},{"location":"chapter3/","page":"3 Start the MiniConda container","title":"3 Start the MiniConda container","text":"Command Comment\ndocker container ls list al running (active) containers.\ndocker container ls -a List all the containers, also not running.\ndocker container rm testjupyter-notebook1 Delete a container.\ndocker container rm ef6f974a579f Delete a container by its id.\ndocker image ls List all repositories (images).","category":"page"},{"location":"chapter5/#Create-the-.env-file-for-API-keys","page":"5 Create the .env file for API keys","title":"Create the .env file for API keys","text":"","category":"section"},{"location":"chapter5/","page":"5 Create the .env file for API keys","title":"5 Create the .env file for API keys","text":"UNDER DEVELOPMENT","category":"page"},{"location":"#LLMs","page":"Introduction","title":"LLMs","text":"","category":"section"},{"location":"","page":"Introduction","title":"Introduction","text":"UNDER DEVELOPMENT","category":"page"},{"location":"","page":"Introduction","title":"Introduction","text":"This course is a supplement to Ed Donner's course on Udemy: 'LLM Engineering: Master AI & Large Language Models (LLMs)' for developers whose work with Ubuntu 22.04'.","category":"page"},{"location":"","page":"Introduction","title":"Introduction","text":"info: Info\nLook at Blog for the latest remarks!","category":"page"},{"location":"","page":"Introduction","title":"Introduction","text":"Content","category":"page"},{"location":"","page":"Introduction","title":"Introduction","text":"Pages = [\"index.md\"]","category":"page"},{"location":"#Introduction","page":"Introduction","title":"Introduction","text":"","category":"section"},{"location":"","page":"Introduction","title":"Introduction","text":"My name is Rob Bontekoe and I am attendig Ed Donner's Udemy course LLM Engineering: Master AI & Large Language Models (LLMs).","category":"page"},{"location":"","page":"Introduction","title":"Introduction","text":"<img src=\"data:image/jpeg;base64,\" alt=\"Docker logo\" width=\"120\">","category":"page"},{"location":"","page":"Introduction","title":"Introduction","text":"Logo Ed Donner's course","category":"page"},{"location":"","page":"Introduction","title":"Introduction","text":"I work with Ubuntu 22.04 Desktop version. I asked Ed whether I could attend the course using MiniConda. He said: \"Hey Rob, I haven't tested miniconda myself, but another student mentioned that he used miniconda and everything went great. I'd actually be super grateful if you could give it a whirl and let me know - then I can update the instructions with this as an approach. Thanks so much Ed.\"","category":"page"},{"location":"","page":"Introduction","title":"Introduction","text":"I also prefer to use Docker, because it gives you less trouble on your system. Looking at https://docs.anaconda.com/anaconda/install/ I saw in step 4 https://docs.anaconda.com/working-with-conda/applications/docker/ the next Docker instruction:","category":"page"},{"location":"","page":"Introduction","title":"Introduction","text":"docker run -i -t -p 8888:8888 continuumio/miniconda3 /bin/bash \\\n-c \"/opt/conda/bin/conda install jupyter -y --quiet && mkdir \\\n/opt/notebooks && /opt/conda/bin/jupyter notebook \\\n--notebook-dir=/opt/notebooks --ip='*' --port=8888 \\\n--no-browser --allow-root\"","category":"page"},{"location":"","page":"Introduction","title":"Introduction","text":"Because I prefer to use docker-compose I translated the command with Gemini into a compose.yml file which I can use with docker-compose to create de container automatically. ","category":"page"},{"location":"","page":"Introduction","title":"Introduction","text":"The advantage was that I only had to restart the container and could use a one time generated api key to enter Jupyter notebooks.","category":"page"},{"location":"","page":"Introduction","title":"Introduction","text":"version: \"3.9\" # Use the latest version of the Docker Compose file format\n\nservices:\n  jupyter-notebook:\n    image: continuumio/miniconda3\n    ports:\n      - \"8888:8888\"\n    command: \n      - /bin/bash\n      - \"-c\"\n      - |\n        conda install jupyter -y --quiet && \\\n        mkdir -p /opt/notebooks && \\\n        jupyter notebook \\\n          --notebook-dir=/opt/notebooks \\\n          --ip='*' \\\n          --port=8888 \\\n          --no-browser \\\n          --allow-root\n    volumes:\n      - ./notebooks:/opt/notebooks \n    tty: true\n    stdin_open: true","category":"page"},{"location":"","page":"Introduction","title":"Introduction","text":"I hope you appreciate this approach. ","category":"page"},{"location":"","page":"Introduction","title":"Introduction","text":"Rob Bontekoe","category":"page"},{"location":"","page":"Introduction","title":"Introduction","text":"info: This course is licensed under the MIT License.\nAn MIT license is a type of software license, also known as an open-source license. It's one of the most permissive licenses available, meaning it grants users a wide range of freedoms to use, modify, and distribute the software.","category":"page"}]
